import React from "react";
import "./demo.css"; // css WXSS global.css

export const MyComponent = () => {
    // setState  setData
    // data: {
        // myName: 'John Doe'
    // }
    // MVVM
    // react hooks setData
    const [myName, setMyName] = React.useState('John Doe');


    return(
        // template 不是html
        <div>
            <h2 className="title">{myName}</h2>
            <input
                value = {myName}
                onChange = {(e) => setMyName(e.target.value) }
            />
         </div>
    )
}
